import { Switch, React } from 'react';
import { Route } from 'react-router-dom';
import './App.css';

import Homepage from './pages/homepage/homepage.component';

const HatsPage = () => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
)

function App() {
  return (
    <div>
      <Switch>
        <Route exact path='/' component={Homepage} />
        <Route exact path='/hats' component={Homepage} />
      </Switch>
    </div>
  );
}

export default App;
